import React, { useState, useEffect } from "react";
import axios from "axios";
// import { PDFDownloadLink, Document, Page, Text, StyleSheet } from "@react-pdf/renderer";
import "./button.css";
import { Nav } from "../components/NavBar/NavElements";
import NavItem from "../components/NavBar/NavItem";

function Analysis() {
  const [items, setItems] = useState([]);

  const getResults = async () => {
    try {
      const response = await axios.get("http://localhost:5000/analysis");
      console.log(response.data);
      setItems(response.data); // Set the items state with the response data
    } catch (error) {
      alert('Logging Error: ' + error.response.data.error);
    }
  };

  useEffect(() => {
    getResults();
  }, []);

