//   });

  return (
    <div style={{ height: "80vh" }}>
      <h1>All Results</h1>
      <table style={{ width: "100%" }}>
        <thead>
          <tr>
            <th>Temperature</th>
            <th>Time Stamp</th>
          </tr>
        </thead>
        <tbody>
          {items.map((item, index) => (
            <tr key={index}>
              <td style={{ fontSize: "18px" }}>{item.max_temp}</td>
              <td style={{ fontSize: "18px" }}>{item.time_max}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default Analysis;
